  const [recentlyPlayed, setRecentlyPlayed] = useState([
    {
      id: 7,
      title: "Kehne Lagaa",
      artist: "Rushil Aswal",
      mood: "Sad",
      coverUrl: "https://t2.genius.com/unsafe/378x378/https%3A%2F%2Fimages.genius.com%2Ff99353f2e00ef3bb0e2e1bf76e262f80.300x300x1.jpg"
    },
