            <Link to="/mood/romantic" className="mood-card romantic">
              <h3>Romantic</h3>
            </Link>
            <Link to="/mood/focus" className="mood-card focus">
              <h3>Focus</h3>
            </Link>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Dashboard;
